import axios from "axios";
export const getAllMaps = async (req, res) => {
  const response = await axios.get(
    `http://localhost:8080/Auth/getAllMapOfUser`,
    {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    }
  );
  return response.data;
};
export const updateMap = async (req, res) => {
  const response = await axios.put(
    `http://localhost:8080/Auth/updateMap/${localStorage.getItem("userid")}`,
    req,
    {
      headers: { Authorization: `Bearer ${localStorage.getItem("token")}` },
    }
  );
  return response;
};
//http://localhost:8080/Auth/updateMap/63666837deb4718624994e86 http://localhost:8080/Map/

